import React from 'react'
import { NavLink } from 'react-router-dom'

class Sidebuttons extends React.Component{
    render(){
        return (
            <><div name="button1">
                <NavLink to="/Projects" onClick={handleClick(this)}>{this.props.button_text1}</NavLink>
            </div><div name="button2">
                <NavLink to="/Experience" onClick={handleClick(this)}>{this.props.button_text2}</NavLink>
            </div><div name="button3">
                <NavLink to="/Resume" onClick={handleClick(this)}>{this.props.button_text3}</NavLink>
            </div></>
        )
    }
}

export default Sidebuttons
